// Contact page with support information
function Contact() {
    return (
        <div className="container mt-5">
            <br /><br /><br />
            <h2 className="text-white">Contact</h2>
            <p className="text-white">Email: support@snowboardingbetting.com</p>
            <p className="text-white">Phone: +1-800-SNOWBET</p>
            <p className="text-white">Address: 123 Snowboard St, Winter City, WC 45678</p>
            <p className="text-white">No Unwanted Calls. Yes, this color is intentional.</p>
            <footer className="site-footer"></footer>
    </div>
    )
}

export default Contact
